import './App.css';
import Logo from './components/Logo';
import Search from './components/Search';
import Card from './components/Card';

class App extends component {
  constructor(props) {
    super(props);
    this.state = {
      location: '',
      weather: '',
      typing: '',
    };
  }

  render() {
    return (
      <div className="App">
        <Logo />
        <Search />
        <Card />
      </div>
    );
  }
}

export default App;
